import React from 'react';
import Menu2 from "./menu2";
import Make from "./make";
import Lisaosat from "./lisaosat";
import Prices from "./prices";
import Contact2 from "./contact2";

const BuildPage = () => {
    return (
        <div>
            <Menu2/>
            <div id="Make">
                <Make/>
            </div>
            <div id="Lisaosat">
                <Lisaosat/>
            </div>
            <div id="Prices">
                <Prices/>
            </div>
            <Contact2/>

        </div>
    );
}

export default BuildPage;
